PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE listing (
	listing_id VARCHAR(16) NOT NULL,
	title VARCHAR(128) NOT NULL,
	description VARCHAR(4096),
	release_date DATE,
	PRIMARY KEY (listing_id)
);
CREATE TABLE genre (
	genre_id INTEGER NOT NULL,
	genre VARCHAR(16) NOT NULL,
	PRIMARY KEY (genre_id)
);
CREATE TABLE person (
	person_id VARCHAR(16) NOT NULL,
	name VARCHAR(128) NOT NULL,
	PRIMARY KEY (person_id)
);
CREATE TABLE "user" (
	username VARCHAR(32) NOT NULL,
	password VARCHAR(128) NOT NULL,
	PRIMARY KEY (username)
);
CREATE TABLE "listing_Actors" (
	listing_id INTEGER NOT NULL,
	person_id VARCHAR(16) NOT NULL,
	PRIMARY KEY (listing_id, person_id),
	FOREIGN KEY(listing_id) REFERENCES listing (listing_id),
	FOREIGN KEY(person_id) REFERENCES person (person_id)
);
CREATE TABLE listing_writers (
	listing_id INTEGER NOT NULL,
	person_id VARCHAR(16) NOT NULL,
	PRIMARY KEY (listing_id, person_id),
	FOREIGN KEY(listing_id) REFERENCES listing (listing_id),
	FOREIGN KEY(person_id) REFERENCES person (person_id)
);
CREATE TABLE listing_directors (
	listing_id INTEGER NOT NULL,
	person_id VARCHAR(16) NOT NULL,
	PRIMARY KEY (listing_id, person_id),
	FOREIGN KEY(listing_id) REFERENCES listing (listing_id),
	FOREIGN KEY(person_id) REFERENCES person (person_id)
);
CREATE TABLE user_subscriptions (
	username VARCHAR(32) NOT NULL,
	listing_id VARCHAR(16) NOT NULL,
	PRIMARY KEY (username, listing_id),
	FOREIGN KEY(username) REFERENCES users (username),
	FOREIGN KEY(listing_id) REFERENCES listing (listing_id)
);
CREATE TABLE listing_genres (
	listing_id INTEGER NOT NULL,
	genre_id VARCHAR(16) NOT NULL,
	PRIMARY KEY (listing_id, genre_id),
	FOREIGN KEY(listing_id) REFERENCES listing (listing_id),
	FOREIGN KEY(genre_id) REFERENCES genre (genre_id)
);
CREATE TABLE schedule (
	schedule_id INTEGER NOT NULL,
	listing_id VARCHAR(16),
	title VARCHAR(128),
	season INTEGER,
	episode INTEGER,
	datetime DATETIME,
	PRIMARY KEY (schedule_id),
	FOREIGN KEY(listing_id) REFERENCES listing (listing_id)
);
COMMIT;
